import React from "react";

const CartItem = props => {
  let totalAmount = props.product.price * props.product.quantity;

  return (
    <tr>
      <td>
        <img src={props.product.images[0]} />
      </td>
      <td>{props.product.title}</td>
      <td>{props.product.price}</td>
      <td className="align-middle">
        {" "}
        <div className="def-number-input number-input">
          <button
            onClick={() =>
              console.log("MINUS QUANTITY ITEM: ", props.product.title)
            }
            className="minus"
          ></button>
          <input
            className="quantity"
            name="quantity"
            value={props.product.quantity}
            onChange={() => console.log("change")}
            type="number"
          />
          <button
            onClick={() =>
              console.log("PLUS QUANTITY ITEM: ", props.product.title)
            }
            className="plus"
          ></button>
        </div>
      </td>
      <td>{totalAmount}</td>
      <td>button</td>
    </tr>
  );
};
export default CartItem;
